import React, {useState} from 'react';
import {Layout, Menu, Button, Image} from 'antd';
import {
    MenuUnfoldOutlined,
    MenuFoldOutlined,
    UserOutlined,
    LaptopOutlined,
    NotificationOutlined,
} from '@ant-design/icons';

import './header.css';

const {Header, Sider, Content} = Layout;
const { SubMenu } = Menu;

export const HeaderComponent = () => {
    const [collapsed, setCollapsed] = useState(false);

    const toggleCollapsed = () => {
        setCollapsed(!collapsed);
    };

    return (
        <Layout className="header__wrapper">
            <Sider trigger={null} collapsible collapsed={collapsed}>
                <div className="logo">
                    {collapsed ?
                        <Image
                            width={70}
                            // alt="Иконка"
                            // src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png"
                        />
                        : 'СУПП ДО'}
                </div>
                <Menu theme="dark" mode="inline" defaultSelectedKeys={['1']}>
                    <SubMenu key="sub1" icon={<UserOutlined />} title="Справочники">
                        <Menu.Item key="professions">Профессии</Menu.Item>
                        <Menu.Item key="2">Подразделения</Menu.Item>
                        <Menu.Item key="3">Персонал</Menu.Item>
                    </SubMenu>
                    <SubMenu key="sub2" icon={<LaptopOutlined />} title="Администрирование">
                        <Menu.Item key="5">option5</Menu.Item>
                        <Menu.Item key="6">option6</Menu.Item>
                        <Menu.Item key="7">option7</Menu.Item>
                        <Menu.Item key="8">option8</Menu.Item>
                    </SubMenu>
                    <SubMenu key="sub3" icon={<NotificationOutlined />} title="Пользователь">
                        <Menu.Item key="9">Сменить пароль</Menu.Item>
                        <Menu.Item key="10">Выйти</Menu.Item>
                        <Menu.Item key="11">option11</Menu.Item>
                        <Menu.Item key="12">option12</Menu.Item>
                    </SubMenu>
                </Menu>
            </Sider>
            <Layout className="site-layout">
                <Header className="site-layout-background" style={{padding: 0, height: 64}}>
                    <div style={{width: '100%', heigth: 64, lineHeigth: 64}}>
                        <Button type="primary" onClick={toggleCollapsed} style={{marginLeft: 15}}>
                            {collapsed ? <MenuUnfoldOutlined/> : <MenuFoldOutlined/>}
                        </Button>
                    </div>
                </Header>
                <Content
                    className="site-layout-background"
                    style={{
                        margin: '24px 16px',
                        padding: 24,
                        minHeight: 280,
                    }}
                >
                    Content
                </Content>
            </Layout>
        </Layout>
    );
}
